    marginRight: 25,
  },
  bookpicker: {
    height: 50,
    width: 150,
    marginBottom: 20,
  },
  chapterpicker: {
    height: 50,
    width: 150,
    marginBottom: 30,
  },
  buttons: {
    marginBottom: 30,
